import React from "react";
import Link from "next/link";

import Layout from "../components/Layout";

const Login = () => {
  const login = (e) => {
    e.preventDefault();
  };

  return (
    <React.Fragment>
      <Layout>
        <h1>Login</h1>
        <main>
          <form onSubmit={login}>
            <ul>
              <li className="text">
                <label htmlFor="email">Username/Email: </label>
                <label htmlFor="password">Password: </label>
              </li>
              <li className="inputs">
                <input required type="text" id="identifier" name="identifier" />
                <input required type="password" id="password" name="password" />
              </li>
            </ul>
            <Link href={"/signup"}>
              <a>Don't have an account? Click here</a>
            </Link>
            <button type={"submit"}>Log In</button>
          </form>
        </main>
      </Layout>

      <style jsx>{`
        main {
          width: 100%;
        }

        h1 {
          text-align: center;
          margin-top: 100px;
        }

        ul {
          list-style: none;
          display: flex;
          justify-content: center;
          margin-top: 2em;
        }

        li {
          width: 50%;
          height: 200px;
        }

        .text {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: flex-end;
          margin-right: 4em;
        }

        .inputs {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: flex-start;
        }

        input {
          width: 30%;
        }

        label,
        input {
          margin: 5px 0;
        }

        button {
          margin: 50px 47%;
          width: 100px;
          height: 30px;
        }

        a {
          margin: -50px 45%;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Login;
